import './update-company.css'
import { Field, Formik, Form } from 'formik'
import history from "../../../../history";
import AdminService from "../../../../../../service/AdminService";
import AutenticationService from "../../../../../../service/AutenticationService";
import { values } from 'lodash';

export default function UpdateCompany(props) {

    const handleSubmit = (values) => {

    }


    const back = () => {
        if (window.confirm("Are you sure you want to leave this page?")) {
            history.push("/admin/companies")
        }
    }

    return (
        <div className="UpdateCompany">
            <button type="submit" class="btn btn-primary my-1" title="Add" onClick={back}>
                ←
            </button>

            <h2>Update Company</h2><br />

            <Formik

                initialValues={{ email: props.updateCompany.email, password: "", name: props.updateCompany.name }}
                onSubmit={(values, { setFieldValue }) => handleSubmit(values, { setFieldValue })}

            >
                {({ isValid, dirty, values }) => (
                    <Form >
                        <div class="form-group">
                            <label class="control-label col-sm-2"> Company Name:  </label>
                            <Field class="col-sm-2"
                                type="name"
                                name="name"
                                placeholder="Enter Company Name"
                                required={true}
                                autocomplete={true}
                            />
                        </div>


                        <div class="form-group">

                            <label class="control-label col-sm-2" > Enter your Email </label>
                            <Field class="col-sm-2"
                                type="email"
                                name="email"
                                placeholder="Enter your Email"
                                title={values.email}
                                required={true}
                                autocomplete={true}
                            />

                        </div>
                        <div class="form-group">
                            <label class="control-label col-sm-2"> Enter your Password </label>
                            <Field class="col-sm-2"
                                type="password"
                                name="password"
                                placeholder="Enter your Password"
                                required={true}
                                autocomplete={true}
                            />
                        </div>

                        <button type="submit" class="btn btn-primary my-1" title="Update" disabled={!dirty}>
                            Update
                        </button>

                    </Form>
                )}
            </Formik >




        </div>

    )
}
